  Image of the 10-m Interpolated Bathymetric Grid of the Northern Part of National
  Oceanic and Atmospheric Administration (NOAA) Survey H11044 off Milford, Connecticut
  (H11044N_MB10M_UTM18.TIF, UTM Zone 18, WGS84)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
